import React from "react";
import "../Profile.css"; // Add your CSS file for styling

export interface Education {
  school: string;
  degree: string;
  graduationYear: number;
}

export interface Experience {
  company: string;
  position: string;
  startDate: string;
  endDate: string;
  description: string;
}

interface ProfileProps {
  name: string;
  title: string;
  email: string;
  phone: string;
  linkedIn: string;
  summary: string;
  education: Education[];
  experience: Experience[];
}

const Profile: React.FC<ProfileProps> = ({
  name,
  title,
  email,
  phone,
  linkedIn,
  summary,
  education,
  experience,
}) => {
  return (
    <div className="resume">
      <div class="container">
        <div class="row">
          <div class="col">
            <div className="header">
            <h1>{name}</h1>
            <h2>{title}</h2>
            <ul className="contact">
              <li>Email: {email}</li>
              <li>Phone: {phone}</li>
              <li>LinkedIn: {linkedIn}</li>
              {/* Add more contact details as needed */}
            </ul>
          </div>
          </div>
          <div class="col">
            Column
          </div>
          <div class="col">
            Column
          </div>
        </div>
      </div>












      <div className="summary">
        <h3>Summary</h3>
        <p>{summary}</p>
      </div>
      <div className="education">
        <h3>Education</h3>
        {education.map((edu, index) => (
          <div key={index}>
            <h4>{edu.school}</h4>
            <p>{edu.degree}</p>
            <p>Graduation Year: {edu.graduationYear}</p>
          </div>
        ))}
      </div>
      <div className="experience">
        <h3>Experience</h3>
        {experience.map((exp, index) => (
          <div key={index}>
            <h4>{exp.position}</h4>
            <p>{exp.company}</p>
            <p>
              {exp.startDate} - {exp.endDate}
            </p>
            <p>{exp.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Profile;
